    /**
     * @param s
     * @return
     */
    public int lengthOfLongestSubstring(String s) {
        char[] chars = s.toCharArray();
        ArrayList<Character> characters = new ArrayList<>();
        for (Character c : chars) {
            characters.add(c);
        }
        StringBuilder sb = new StringBuilder();
        ArrayList<Integer> left = new ArrayList<>();
        ArrayList<Integer> right = new ArrayList<>();
        StringBuilder result = new StringBuilder();
        ArrayList<String> leftStrings = new ArrayList<>();
        ArrayList<String> rightStrings = new ArrayList<>();
        result = cutStringAndAddLength(characters, sb, left, leftStrings, right, rightStrings);
        leftStrings.add(result.toString());
        left.add(result.length());

        System.out.println(leftStrings.toString());
        System.out.println(Collections.max(left));
        result = rightCutStringAndAddLength(characters, new StringBuilder(), left, leftStrings, right, rightStrings);
        rightStrings.add(result.toString());
        right.add(result.length());
        System.out.println(rightStrings.toString());
        System.out.println(Collections.max(right));
        return Collections.max(left);
    }

    private StringBuilder cutStringAndAddLength(List<Character> characters, StringBuilder sb, List<Integer> left, List<String> leftStrings, List<Integer> right, List<String> rightStrings) {
        for (int i = 0; i < characters.size(); i++) {
            if (!sb.toString().contains(String.valueOf(characters.get(i)))) {
                sb.append(characters.get(i));
            } else {
                sb.append(characters.get(i));
                List<Character> subList = characters.subList(i + 1, characters.size());
                leftStrings.add(sb.substring(0, sb.length() - 1));
                left.add(sb.substring(0, sb.length() - 1).length());
                sb.replace(0, sb.length() - 1, "");
                return cutStringAndAddLength(subList, sb, left, leftStrings, right, rightStrings);
            }
        }
        return sb;
    }

    private StringBuilder rightCutStringAndAddLength(List<Character> characters, StringBuilder sb, List<Integer> left, List<String> leftStrings, List<Integer> right, List<String> rightStrings) {
        for (int i = 0; i < characters.size(); i++) {
            if (!sb.toString().contains(String.valueOf(characters.get(i)))) {
                sb.append(characters.get(i));
            } else {
                int x = sb.indexOf(String.valueOf(characters.get(i)));
                sb.append(characters.get(i));
                List<Character> subList = characters.subList(i + 1, characters.size());
//                leftStrings.add(sb.substring(0, sb.length() - 1));
                rightStrings.add(sb.substring(0, x + 1));
//                left.add(sb.substring(0, sb.length() - 1).length());
                right.add(sb.substring(0, x + 1).length());
                sb.replace(0, x + 1, "");
                return rightCutStringAndAddLength(subList, sb, left, leftStrings, right, rightStrings);
            }
        }
        return sb;
    }
